import React from 'react'
import { useLocation } from 'react-router-dom'

function ActivityList() {
    const location = useLocation()
    const { username, password } = location.state || {}

    return (
        <div>
            <h1>Activity List</h1>
            <p>账号: {username}</p>
            <p>密码: {password}</p>
        </div>
    )
}

export default ActivityList
